const rows = msg.payload; // Datos obtenidos de FastCheck
if (rows.length === 0) {
    msg.payload = "No hay datos para transferir.";
    return msg; // Detener si no hay datos
}

const queries = rows.map(row => {
    return `
        INSERT INTO data_recibida (rut_alumno, PRESENTE, COD_CLASE)
        VALUES (${row.rut_alumno}, ${row.PRESENTE}, ${row.COD_CLASE || 'NULL'});
    `;
}).join(" ");

msg.topic = queries; // Todas las inserciones concatenadas
return msg;
